    <li>
        Explanation
        <div>
            <p>
                You should run az group update to assign taxonomic tags to an Azure resource group like so:
            </p>
            <p>
                az group update --name prod-rg --set tags.Dept=IT
            </p>
            <p>
                Note that this command overwrites any existing tags on the resource group. In that case, you would need to edit your Azure CLI code to retrieve the existing tags, reformat that value, and then reapply the existing and new tags.
            </p>
            <p>
                You should not run the az resource tag command. This command applies tags at the individual resource level, but not the resource group level.
            </p>
            <p>
                You should not run the az policy assignment command. This command assigns an Azure Policy to a management gro");
            WriteLiteral(@"up or resource group.
            </p>
            <p>
                You should not run the az tag add-value command. This command edits the value of a previously created Azure taxonomic tag.
            </p>
        </div>
    </li>
